    def parse(self, response):
        result = []
        result.append(response.meta['postcode'])
        fields = ['Detached','Semi-Detached','Terraced','Flat (Purpose-Built)','Flat (Converted)',
                'Residence in Commercial Building','Owned Outright','Owned with Mortgage','Shared Ownership',
                'Rented: From Council','Rented: Other Social','Rented: Private Landlord','Rented: Other','Rent Free',
                'One Person','Two People','Three People','Four People','Five People','Six People','Seven People',
                '8+ People']
        for field in fields:
            result.append(get_exact_field(response, field))
        
        fields = ['AB','C1','C2','DE']
        for field in fields:
            result.append(get_contains_field(response, field))
                
        fields = ['Male','Female']
        for field in fields:
            result.append(get_exact_field(response, field))

        fields = ['0 to 4','5 to 7','8 to 9','10 to 14','15','16 to 17',
                '18 to 19','20 to 24','25 to 29','30 to 44','45 to 59','60 to 64','65 to 74','75 to 84','85 to 89','90+']
        for field in fields:
            result.append(get_dash_field(response, field)) 

        fields = ['Single','Married','Divorced','Separated','Widowed','Same Sex','Very Good','Good','Fair','Bad','Very Bad',
                'Degree or Similar','Apprenticeship','HNC, HND or 2+ A Levels','5+ GCSEs, an A-Level or 1-2 AS Levels',
                '1-4 GCSEs or Equivalent','No GCSEs or Equivalent']
        for field in fields:
            result.append(get_exact_field(response, field))
                
        result.append(get_people_other(response))

        fields =  ['White','Mixed Ethnicity','Indian','Bangladeshi', 'Chinese','Other Asian','Black African']
        for field in fields:
            result.append(get_exact_field(response, field))
        
        result.append(get_culture_other(response))

        fields = ['England','Wales','Scotland','Northern Ireland','Republic of Ireland', 'European Union'] 
        for field in fields:
            result.append(get_exact_field(response, field))

        result.append(get_country_other(response))

        fields = ['United Kingdom','Republic of Ireland','Europe (including European Union)',
                'African Countries','Middle East or Asia','North America or Caribbean','Central America','South America',
                'Oceania','None','Christian','No Religion','Buddhist','Hindu','Jewish','Muslim','Sikh','Other Religion',
                'Not Stated','Full-Time Employee','Part-Time Employee','Self Employed','Unemployed','Full-Time Student',
                'Retired','Looking After Home or Family','Long-Term Sick or Disabled']

        for field in fields:
            result.append(get_exact_field(response, field))

        result.append(get_emp_other(response))

        self.results.append(result)

